INSERT INTO `sys_log_operate` VALUES (411, 'swing', 'tikuQuestion', 'A', 'POST', 'http://121.199.69.84:8085/tiku/question/add', '{\"reviewPoint\":\"\",\"use\":true,\"orderNum\":1,\"remark\":\"\",\"updateTime\":1597213600636,\"content\":\"一台三相异步电动机的额定数据如下：U N =380V ，I N =2.9A ，f N =50HZ ，ηN =0.82，λN =0.83,n N =1470r/min ， ?形接法。试问：这是一台几极的电动机？在额定工作状态下的转差率，转子电流的频率，输出功率和额定转矩各是多少？若电动机的起动转矩为额定转矩的2.2倍时，采用Y-?降压起动时的起动转矩？\",\"createBy\":\"swing\",\"createTime\":1597213600636,\"updateBy\":\"swing\",\"fullContent\":\"<p><span style=\\\"color: rgb(51, 51, 51); font-family: Arial, 宋体; font-size: 18px; text-indent: 36px;\\\">一台三相异步电动机的额定数据如下：U N =380V ，I N =2.9A ，f N =50HZ ，ηN =0.82，λN =0.83,n N =1470r/min ， ?形接法。试问：这是一台几极的电动机？在额定工作状态下的转差率，转子电流的频率，输出功率和额定转矩各是多少？若电动机的起动转矩为额定转矩的2.2倍时，采用Y-?降压起动时的起动转矩？</span><br></p>\",\"auditStatus\":\"A\",\"id\":112,\"courseId\":105,\"questionType\":\"C\"}', '{\"msg\":\"配置信息插入成功！\",\"status\":200}', 1, '操作成功', 'com.swing.sky.system.api.tiku.TiQuestionController.addSave()', 'A', '117.150.241.195', '亚洲-中国-湖北', 'Windows 10', 'Chrome 8', '2020-08-12 14:26:41');
INSERT INTO `sys_log_operate` VALUES (412, 'swing', 'tikuQuestion', 'A', 'POST', 'http://121.199.69.84:8085/tiku/question/add', '{\"reviewPoint\":\"\",\"use\":true,\"orderNum\":1,\"remark\":\"\",\"updateTime\":1597213638712,\"content\":\"某搬运机由三相异步电动机拖动，其控制要求：正转到达预定位置后自动停车，50s 后自动反转；反转到达预定位置后自动停车；具有短路、过载和零压保护。(1KM 控制电动机的正转，2KM 控制电动机的反转) 试：1 画出三相异步电动机的完整控制电路，包括主电路部分和控制电路部分；2 简述电路从1KM 线圈通电换到2KM 线圈通电的操作过程；3 画出由PLC 实现上述功能的外部输入/输出接线图、梯形图。\",\"createBy\":\"swing\",\"createTime\":1597213638712,\"updateBy\":\"swing\",\"fullContent\":\"<p style=\\\"padding: 0px; text-indent: 2em; color: rgb(51, 51, 51); font-family: Arial, 宋体; font-size: 18px;\\\">某搬运机由三相异步电动机拖动，其控制要求：正转到达预定位置后自动停车，50s 后自动反转；反转到达预定位置后自动停车；具有短路、过载和零压保护。(1KM 控制电动机的正转，2KM 控制电动机的反转) 试：</p><p style=\\\"padding: 0px; text-indent: 2em; color: rgb(51, 51, 51); font-family: Arial, 宋体; font-size: 18px;\\\">1 画出三相异步电动机的完整控制电路，包括主电路部分和控制电路部分；</p><p style=\\\"padding: 0px; text-indent: 2em; color: rgb(51, 51, 51); font-family: Arial, 宋体; font-size: 18px;\\\">2 简述电路从1KM 线圈通电换到2KM 线圈通电的操作过程；</p><p style=\\\"padding: 0px; text-indent: 2em; color: rgb(51, 51, 51); font-family: Arial, 宋体; font-size: 18px;\\\">3 画出由PLC 实现上述功能的外部输入/输出接线图、梯形图。</p>\",\"auditStatus\":\"A\",\"id\":113,\"courseId\":105,\"questionType\":\"B\"}', '{\"msg\":\"配置信息插入成功！\",\"status\":200}', 1, '操作成功', 'com.swing.sky.system.api.tiku.TiQuestionController.addSave()', 'A', '117.150.241.195', '亚洲-中国-湖北', 'Windows 10', 'Chrome 8', '2020-08-12 14:27:19');
