INSERT INTO `sys_log_operate` VALUES (449, 'swing', 'tikuQuestion', 'B', 'POST', 'http://121.199.69.84:8085/tiku/question/edit', '{\"reviewPoint\":\"\",\"use\":true,\"orderNum\":1,\"remark\":\"\",\"updateTime\":1597637041690,\"content\":\"某搬运机由三相异步电动机拖动，其控制要求：正转到达预定位置后自动停车，50s 后自动反转；反转到达预定位置后自动停车；具有短路、过载和零压保护。(1KM 控制电动机的正转，2KM 控制电动机的反转) 试：1 画出三相异步电动机的完整控制电路，包括主电路部分和控制电路部分；2 简述电路从1KM 线圈通电换到2KM 线圈通电的操作过程；3 画出由PLC 实现上述功能的外部输入/输出接线图、梯形图。\",\"updateBy\":\"swing\",\"fullContent\":\"<p>某搬运机由三相异步电动机拖动，其控制要求：正转到达预定位置后自动停车，50s 后自动反转；反转到达预定位置后自动停车；具有短路、过载和零压保护。(1KM 控制电动机的正转，2KM 控制电动机的反转) 试：</p><p><br></p><p>1 画出三相异步电动机的完整控制电路，包括主电路部分和控制电路部分；</p><p>2 简述电路从1KM 线圈通电换到2KM 线圈通电的操作过程；</p><p>3 画出由PLC 实现上述功能的外部输入/输出接线图、梯形图。</p>\",\"auditStatus\":\"A\",\"id\":113,\"courseId\":105,\"questionType\":\"B\"}', '{\"msg\":\"题目信息更新成功！\",\"status\":200}', 1, '操作成功', 'com.swing.sky.system.api.tiku.TiQuestionController.editSave()', 'A', '117.150.243.72', '亚洲-中国-湖北', 'Windows 10', 'Chrome 8', '2020-08-17 12:04:03');
