INSERT INTO `sys_log_operate` VALUES (462, 'swing', 'tikuQuestion', 'A', 'POST', 'http://localhost:8085/tiku/question/add', '{\"reviewPoint\":\"\",\"use\":true,\"orderNum\":1,\"remark\":\"\",\"updateTime\":1597722364141,\"content\":\"根据题1-1图所示的电动机速度控制系统工作原理图(1) 将a，b与c，d用线连接成负反馈状态；(2) 画出系统方框图\",\"createBy\":\"swing\",\"createTime\":1597722364141,\"updateBy\":\"swing\",\"fullContent\":\"<p>根据题1-1图所示的电动机速度控制系统工作原理图</p><p>(1) 将a，b与c，d用线连接成负反馈状态；</p><p>(2) 画出系统方框图</p><p><img src=\\\"https://swing-durian.oss-cn-beijing.aliyuncs.com/2f/9d/2f9d4dfde8f147f2ba50edcee1ce57c6.png\\\" data-filename=\\\"image.png\\\" style=\\\"width: 290.183px; height: 148px;\\\"><br></p>\",\"auditStatus\":\"A\",\"id\":116,\"courseId\":106,\"questionType\":\"C\"}', '{\"msg\":\"配置信息插入成功！\",\"status\":200}', 1, '操作成功', 'com.swing.sky.system.api.tiku.TiQuestionController.addSave()', 'A', '127.0.0.1', '-保留-', 'Windows 10', 'Chrome 8', '2020-08-18 11:46:04');
INSERT INTO `sys_log_operate` VALUES (463, 'swing', 'tikuAnswer', 'A', 'POST', 'http://localhost:8085/tiku/answer/add', '{\"questionId\":116,\"use\":true,\"remark\":\"\",\"updateTime\":1597722572689,\"analysis\":\"<p>无</p>\",\"createBy\":\"swing\",\"answer\":\"<p>(1）负反馈连接方式为：a--&gt;d , b--&gt;c；</p><p><br></p><p>(2）系统方框图如图解1-1 所示</p><p><img src=\\\"https://swing-durian.oss-cn-beijing.aliyuncs.com/06/04/0604c092b57944d18f9f6f4c708db442.png\\\" data-filename=\\\"image.png\\\" style=\\\"width: 209.578px; height: 102.153px;\\\"><br></p>\",\"createTime\":1597722572689,\"updateBy\":\"swing\",\"auditStatus\":\"A\",\"id\":107}', '{\"msg\":\"新增成功！\",\"status\":200}', 1, '操作成功', 'com.swing.sky.system.api.tiku.TiAnswerController.addSave()', 'A', '127.0.0.1', '-保留-', 'Windows 10', 'Chrome 8', '2020-08-18 11:49:33');
INSERT INTO `sys_log_operate` VALUES (464, 'swing', 'tikuQuestion', 'A', 'POST', 'http://localhost:8085/tiku/question/add', '{\"reviewPoint\":\"\",\"use\":true,\"orderNum\":1,\"remark\":\"\",\"updateTime\":1597722629214,\"content\":\"题1-2图是仓库大门自动控制系统原理示意图。试说明系统自动控制大门开闭的工作原理，并画出系统方框图\",\"createBy\":\"swing\",\"createTime\":1597722629214,\"updateBy\":\"swing\",\"fullContent\":\"<p>题1-2图是仓库大门自动控制系统原理示意图。试说明系统自动控制大门开闭的工作原理，并画出系统方框图</p><p><img src=\\\"https://swing-durian.oss-cn-beijing.aliyuncs.com/d0/1e/d01e6265cdce4acd8b2d8f47ff66735e.png\\\" data-filename=\\\"image.png\\\" style=\\\"width: 334.772px; height: 203px;\\\"><br></p>\",\"auditStatus\":\"A\",\"id\":117,\"courseId\":106,\"questionType\":\"C\"}', '{\"msg\":\"配置信息插入成功！\",\"status\":200}', 1, '操作成功', 'com.swing.sky.system.api.tiku.TiQuestionController.addSave()', 'A', '127.0.0.1', '-保留-', 'Windows 10', 'Chrome 8', '2020-08-18 11:50:29');
INSERT INTO `sys_log_operate` VALUES (465, 'swing', 'tikuAnswer', 'A', 'POST', 'http://localhost:8085/tiku/answer/add', '{\"questionId\":117,\"use\":true,\"remark\":\"\",\"updateTime\":1597722697900,\"analysis\":\"<p>无</p>\",\"createBy\":\"swing\",\"answer\":\"<p>当合上开门开关时，电桥会测量出开门位置与大门实际位置间对应的偏差电压，偏差电压经放大器放大后，驱动伺服电动机带动绞盘转动，将大门向上提起。与此同时，和大门连在一起的电刷也向上移动，直到桥式测量电路达到平衡，电动机停止转动，大门达到开启位置。反之，当合上关门开关时，电动机带动绞盘使大门关闭，从而可以实现大门远距离开闭自动控制。系统方框图如图</p><p><img src=\\\"https://swing-durian.oss-cn-beijing.aliyuncs.com/22/a8/22a8d6d284894a4d9d603d3c702a3d98.png\\\" data-filename=\\\"image.png\\\" style=\\\"width: 501.578px; height: 70.5584px;\\\"><br></p>\",\"createTime\":1597722697900,\"updateBy\":\"swing\",\"auditStatus\":\"A\",\"id\":108}', '{\"msg\":\"新增成功！\",\"status\":200}', 1, '操作成功', 'com.swing.sky.system.api.tiku.TiAnswerController.addSave()', 'A', '127.0.0.1', '-保留-', 'Windows 10', 'Chrome 8', '2020-08-18 11:51:38');
INSERT INTO `sys_log_operate` VALUES (466, 'swing', 'tikuQuestion', 'A', 'POST', 'http://localhost:8085/tiku/question/add', '{\"reviewPoint\":\"\",\"use\":true,\"orderNum\":1,\"remark\":\"\",\"updateTime\":1597722760423,\"content\":\"图为工业炉温自动控制系统的工作原理图。分析系统的工作原理，指出被控对象、被控量和给定量，画出系统方框图\",\"createBy\":\"swing\",\"createTime\":1597722760423,\"updateBy\":\"swing\",\"fullContent\":\"<p>图为工业炉温自动控制系统的工作原理图。分析系统的工作原理，指出被控对象、被控量和给定量，画出系统方框图</p><p><img src=\\\"https://swing-durian.oss-cn-beijing.aliyuncs.com/e4/02/e40248c9ef7a4c7b9276000ae3c6c136.png\\\" data-filename=\\\"image.png\\\" style=\\\"width: 447.344px; height: 184.235px;\\\"><br></p>\",\"auditStatus\":\"A\",\"id\":118,\"courseId\":106,\"questionType\":\"C\"}', '{\"msg\":\"配置信息插入成功！\",\"status\":200}', 1, '操作成功', 'com.swing.sky.system.api.tiku.TiQuestionController.addSave()', 'A', '127.0.0.1', '-保留-', 'Windows 10', 'Chrome 8', '2020-08-18 11:52:41');
INSERT INTO `sys_log_operate` VALUES (467, 'swing', 'tikuAnswer', 'A', 'POST', 'http://localhost:8085/tiku/answer/add', '{\"questionId\":118,\"use\":true,\"remark\":\"\",\"updateTime\":1597722888484,\"analysis\":\"<p>无</p>\",\"createBy\":\"swing\",\"answer\":\"<p>加热炉采用电加热方式运行，加热器所产生的热量与调压器电压cu的平方成正比，cu增高，炉温就上升，cu的高低由调压器滑动触点的位置所控制，该触点由可逆转的直流电动机驱动。炉子的实际温度用热电偶测量，输出电压fu。fu作为系统的反馈电压与给定电压ru进行比较，得出偏差电压eu，经电压放大器、功率放大器放大成au后，作为控制电动机的电枢电压。     </p><p>在正常情况下，炉温等于某个期望值T°C，热电偶的输出电压fu正好等于给定电压ru。此时，0freuuu，故01auu，可逆电动机不转动，调压器的滑动触点停留在某个合适的位置上，使cu保持一定的数值。这时，炉子散失的热量正好等于从加热器吸取的热量，形成稳定的热平衡状态，温度保持恒定。 </p><p>当炉膛温度T°C由于某种原因突然下降(例如炉门打开造成的热量流失)，则出现以下的控制过程： </p><p>控制的结果是使炉膛温度回升，直至T°C的实际值等于期望值为止</p><p><img src=\\\"https://swing-durian.oss-cn-beijing.aliyuncs.com/81/53/8153f85149c4451691cc371c2797d6d5.png\\\" data-filename=\\\"image.png\\\" style=\\\"width: 50%;\\\"></p><p>系统中，加热炉是被控对象，炉温是被控量，给定量是由给定电位器设定的电压ru（表征炉温的希望值）</p><p><img src=\\\"https://swing-durian.oss-cn-beijing.aliyuncs.com/65/3e/653e930496e74b25b47c71e8b2363721.png\\\" data-filename=\\\"image.png\\\" style=\\\"width: 592.578px; height: 123.3px;\\\"></p><p><br></p>\",\"createTime\":1597722888484,\"updateBy\":\"swing\",\"auditStatus\":\"A\",\"id\":109}', '{\"msg\":\"新增成功！\",\"status\":200}', 1, '操作成功', 'com.swing.sky.system.api.tiku.TiAnswerController.addSave()', 'A', '127.0.0.1', '-保留-', 'Windows 10', 'Chrome 8', '2020-08-18 11:54:50');
INSERT INTO `sys_log_operate` VALUES (468, 'swing', 'tikuAnswer', 'B', 'POST', 'http://localhost:8085/tiku/answer/edit', '{\"questionId\":118,\"use\":true,\"remark\":\"\",\"updateTime\":1597726722456,\"analysis\":\"<p>无</p>\",\"answer\":\"<p>加热炉采用电加热方式运行，加热器所产生的热量与调压器电压cu的平方成正比，cu增高，炉温就上升，cu的高低由调压器滑动触点的位置所控制，该触点由可逆转的直流电动机驱动。炉子的实际温度用热电偶测量，输出电压fu。fu作为系统的反馈电压与给定电压ru进行比较，得出偏差电压eu，经电压放大器、功率放大器放大成au后，作为控制电动机的电枢电压。     </p><p>在正常情况下，炉温等于某个期望值T°C，热电偶的输出电压fu正好等于给定电压ru。此时，0freuuu，故01auu，可逆电动机不转动，调压器的滑动触点停留在某个合适的位置上，使cu保持一定的数值。这时，炉子散失的热量正好等于从加热器吸取的热量，形成稳定的热平衡状态，温度保持恒定。 </p><p>当炉膛温度T°C由于某种原因突然下降(例如炉门打开造成的热量流失)，则出现以下的控制过程： </p><p>控制的结果是使炉膛温度回升，直至T°C的实际值等于期望值为止</p><p><img src=\\\"https://swing-durian.oss-cn-beijing.aliyuncs.com/81/53/8153f85149c4451691cc371c2797d6d5.png\\\" data-filename=\\\"image.png\\\" style=\\\"width: 397.175px; height: 38.9865px;\\\"></p><p>系统中，加热炉是被控对象，炉温是被控量，给定量是由给定电位器设定的电压ru（表征炉温的希望值）</p><p><img src=\\\"https://swing-durian.oss-cn-beijing.aliyuncs.com/65/3e/653e930496e74b25b47c71e8b2363721.png\\\" data-filename=\\\"image.png\\\" style=\\\"width: 492.175px; height: 102.087px;\\\"></p><p><br></p>\",\"updateBy\":\"swing\",\"auditStatus\":\"A\",\"id\":109}', '{\"msg\":\"更新成功！\",\"status\":200}', 1, '操作成功', 'com.swing.sky.system.api.tiku.TiAnswerController.editSave()', 'A', '127.0.0.1', '-保留-', 'Windows 10', 'Chrome 8', '2020-08-18 12:58:43');
