INSERT INTO `sys_log_operate` VALUES (535, 'swing', 'notice', 'A', 'POST', 'https://qiu-qian.top:8085/system/notice/add', '{\"noticeContent\":\"<p><span style=\\\"background-color: rgb(206, 198, 206);\\\">公告</span>是行政公文的主要文种之一，它和通告都属于发布范围广泛的晓谕性文种。公告是向国内外宣布重要事项或者法定事项时使用的公文。适用于向国内外宣布重要事项或者法定事项。</p><p>公告是用于向国内外宣布重要事项或者法定事项的公文。公告主要有两种，一是宣布重要事项，如最近中国将在东海进行地对地导弹发射训练；二是宣布法定事项，如宣布某项法规或规章，宣布国家领导人选举结果。</p><p>然而，公告在实际使用中，往往偏离了《国家行政机关公文处理办法》中的规定，各机关、单位、团体事无巨细经常使用公告。公告的庄重性特点被忽视，只注意到广泛性和周知性，以致使公告逐渐演变为“公而告之”。</p>\",\"createBy\":\"swing\",\"createTime\":1598708048163,\"updateBy\":\"swing\",\"use\":true,\"orderNum\":1,\"noticeType\":\"2\",\"remark\":\"\",\"updateTime\":1598708048163,\"id\":3,\"noticeTitle\":\"公告公告\"}', '{\"msg\":\"公告信息插入成功！\",\"status\":200}', 1, '操作成功', 'com.swing.sky.system.api.system.NoticeController.addSave()', 'A', '117.136.72.204', '亚洲-中国-云南', 'Windows 10', 'Chrome 8', '2020-08-29 21:34:08');
